INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2023/09/22 14:59:59", 0.0, "クローチェ", 1.47, 10001, "2023/06/30 12:00:00", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", -470.0, 1, 1, 126401, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2023/09/22 14:59:59", 0.0, "クローチェ", 2.15, 10002, "2023/06/30 12:00:00", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", -470.0, 2, 1, 126401, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2023/09/22 14:59:59", 0.0, "ライラエル", 0.0, 10003, "2023/06/30 12:00:00", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", -470.0, 2, 1, 126501, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2023/09/22 14:59:59", 0.0, "ライラエル", 0.0, 10004, "2023/06/30 12:00:00", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", -470.0, 1, 1, 126501, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2023/12/22 14:59:59", 0.0, "リンド", 0.0, 10005, "2023/09/15 15:00:00", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", -470.0, 2, 2, 127702, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2023/12/22 14:59:59", 0.0, "リンド", 0.0, 10006, "2023/09/15 15:00:00", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", -470.0, 2, 2, 127702, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2023/12/22 14:59:59", 0.0, "ヴルム", 0.0, 10007, "2023/09/15 15:00:00", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", -470.0, 1, 2, 127802, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2023/12/22 14:59:59", 0.0, "ヴルム", 6.5, 10008, "2023/09/15 15:00:00", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", -470.0, 2, 2, 127802, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/03/22 14:59:59", 0.0, "アネモネ", 0.0, 10009, "2023/12/15 15:00:00", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", -470.0, 2, 3, 129602, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/03/22 14:59:59", 0.0, "アネモネ", 0.0, 10010, "2023/12/15 15:00:00", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", -470.0, 2, 3, 129602, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/03/22 14:59:59", 0.0, "ネフィ=ネラ", 0.0, 10011, "2023/12/15 15:00:00", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", -470.0, 1, 3, 129701, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/03/22 14:59:59", 0.0, "ネフィ=ネラ", 6.2, 10012, "2023/12/15 15:00:00", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", -470.0, 2, 3, 129701, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (5, "2024/06/22 14:59:59", 0.0, "カノン", 3.1, 10013, "2024/03/15 15:00:00", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", -470.0, 3, 4, 130301, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2024/06/22 14:59:59", 0.0, "カノン", 6.15, 10014, "2024/03/15 15:00:00", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", -470.0, 3, 4, 130301, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2024/06/22 14:59:59", 0.0, "ナーナ", 0.0, 10015, "2024/03/15 15:00:00", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", -470.0, 2, 4, 130401, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/06/22 14:59:59", 0.0, "ナーナ", 3.35, 10016, "2024/03/15 15:00:00", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", -470.0, 2, 4, 130401, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/09/22 14:59:59", 0.0, "ホウオウ", 0.0, 10017, "2024/06/15 15:00:00", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", -470.0, 1, 5, 130502, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/09/22 14:59:59", 0.0, "ホウオウ", 3.18, 10018, "2024/06/15 15:00:00", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", -470.0, 2, 5, 130502, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (4, "2024/09/22 14:59:59", 0.0, "ホウオウ", 0.0, 10019, "2024/06/15 15:00:00", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", -470.0, 4, 5, 130503, 2002, 3);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2024/09/22 14:59:59", 0.0, "ネア", 4.9, 10020, "2024/06/15 15:00:00", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", -470.0, 1, 5, 123301, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2024/09/22 14:59:59", 0.0, "ネア", 4.8, 10021, "2024/06/15 15:00:00", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", -470.0, 1, 5, 123301, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/12/22 14:59:59", 0.0, "カリザ", 4.922, 10022, "2024/09/15 15:00:00", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", -470.0, 3, 6, 133301, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (5, "2024/12/22 14:59:59", 0.0, "カリザ", 9.638, 10023, "2024/09/15 15:00:00", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", -470.0, 3, 6, 133301, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2024/12/22 14:59:59", 0.0, "ミーア", 2.88, 10024, "2024/09/15 15:00:00", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", -470.0, 1, 6, 133401, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2024/12/22 14:59:59", 0.0, "ミーア", 4.818, 10025, "2024/09/15 15:00:00", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", -470.0, 5, 6, 133401, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2025/03/22 14:59:59", 0.0, "グレイス", 1.78, 10026, "2024/12/15 15:00:00", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", -470.0, 2, 7, 133002, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (7, "2025/03/22 14:59:59", 0.0, "グレイス", 6.15, 10027, "2024/12/15 15:00:00", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", -470.0, 1, 7, 133002, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2, "2025/03/22 14:59:59", 0.0, "ヴァイオレット", 4.28, 10028, "2024/12/15 15:00:00", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", -470.0, 6, 7, 133102, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2025/03/22 14:59:59", 0.0, "ヴァイオレット", 0.0, 10029, "2024/12/15 15:00:00", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", -470.0, 1, 7, 133102, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2025/06/23 14:59:59", 0.0, "ルルィ", 5.53, 10030, "2025/03/15 15:00:00", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", -470.0, 2, 8, 136902, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (7, "2025/06/23 14:59:59", 0.0, "ルルィ", 6.05, 10031, "2025/03/15 15:00:00", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", -470.0, 9, 8, 136902, 2002, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2025/06/23 14:59:59", 0.0, "デュラン", 0.0, 10032, "2025/03/15 15:00:00", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", -470.0, 2, 8, 137001, 2002, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1, "2025/06/23 14:59:59", 0.0, "デュラン", 0.0, 10033, "2025/03/15 15:00:00", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", -470.0, 2, 8, 137001, 2002, 2);
